import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  wrapper: { marginBottom: 7 },
  title: { fontSize: 17, paddingVertical: 4 },
  input: {
    borderWidth: 1,
    borderColor: 'lightgrey',
    padding: 5,
    paddingHorizontal: 10,
    fontSize: 19,
    backgroundColor: 'whitesmoke',
  },
});
